import React, { FC } from 'react';
import './styles/component.css';
import './styles/dashboard.css';

const Nightfall: FC = () => {
    return (
        <div className='info'>
            <h4>Nightfall</h4>
            <WeeklyNightfall />
        </div>
    );
};

export default Nightfall;
